import React from 'react'
import '../../styles/App.css';
import '../../styles/styles.css';

function App() {
    return (
        <div className="home">
            <div className="login">
                <button className="login-button">login</button>
            </div>
            <div className="inner-body">
                <h1>trivia_brawl</h1>
                <div className="button-menu">
                    <button className="button first-button">create game</button>
                    <button className="button second-button">join game</button>
                    <button className="login-button">sign up</button>
                </div>
            </div>
        </div>
    );
}

export default App;
